function makeLevel(level){
    const array = new Array(5);
    for(i = 0; i <5; i=i+1)
        if(i < level)
            array[i]=<span class="dot" style="background-color : grey" />;
        else
            array[i]=<span class="dot" style="background-color : red" />;
    return array;
}

function Lang(props){
    <Container>
        <h3>{props.lang}</h3> {makeLevel(props.level)};
    </Container>
} export default Lang;
